package aws

import (
	"context"
	"encoding/json"
	"fmt"
	"github.com/turbot/steampipe-plugin-sdk/grpc/proto"
	"github.com/turbot/steampipe-plugin-sdk/plugin"
	"github.com/turbot/steampipe-plugin-sdk/plugin/transform"
)

var permissionsData []awsIamPermissionData

//// TABLE DEFINITION

func tableAwsIamPermission(_ context.Context) *plugin.Table {
	permissionsData, _ = loadPermissionsData()

	return &plugin.Table{
		Name:        "aws_iam_permission",
		Description: "AWS IAM Permission",
		Get: &plugin.GetConfig{
			KeyColumns:  plugin.SingleColumn("action"),
			Hydrate:     getIamPermission,
			ItemFromKey: permissionFromKey,
		},
		List: &plugin.ListConfig{
			Hydrate: listIamPermissions,
		},
		Columns: []*plugin.Column{
			// "Key" Columns
			{
				Name:        "action",
				Description: "The action for this permission",
				Type:        proto.ColumnType_STRING,
				Transform:   transform.FromGo(),
			},
			{
				Name:        "level",
				Type:        proto.ColumnType_STRING,
				Description: "The mapped level for this action, one of Metadata, ReadOnly, Operator, Admin or Owner",
				Transform:   transform.FromGo(),
			},
		},
	}
}

type awsIamPermissionData struct {
	Action string `json:"action"`
	Level  string `json:"level"`
}

//// ITEM FROM KEY

func permissionFromKey(ctx context.Context, d *plugin.QueryData, _ *plugin.HydrateData) (interface{}, error) {
	quals := d.KeyColumnQuals
	action := quals["action"].GetStringValue()
	item := &awsIamPermissionData{
		Action: action,
	}
	return item, nil
}

//// INITIALISE

func loadPermissionsData() ([]awsIamPermissionData, error) {
	var perms []awsIamPermissionData
	err := json.Unmarshal([]byte(awsIamPermissionDataRaw), &perms)
	if err != nil {
		fmt.Println("Error parsing aws_iam_permission_data", err)
		return nil, err
	}
	return perms, nil
}

//// LIST FUNCTION

func listIamPermissions(ctx context.Context, d *plugin.QueryData, _ *plugin.HydrateData) (interface{}, error) {
	for _, permission := range permissionsData {
		d.StreamListItem(ctx, permission)
	}
	return nil, nil
}

//// HYDRATE FUNCTIONS

func getIamPermission(ctx context.Context, d *plugin.QueryData, h *plugin.HydrateData) (interface{}, error) {
	logger := plugin.Logger(ctx)
	logger.Info("Item", h.Item)
	permission := h.Item.(*awsIamPermissionData)
	for _, permissionData := range permissionsData {
		if permissionData.Action == permission.Action {
			return permissionsData, nil
		}
	}
	return nil, nil
}

